// App.js

import React from 'react';
import NewsFeed from './NewsFeed'; // импорт вашего компонента NewsFeed

const App = () => {
    const news = [
        { title: 'Заголовок новости 1', description: 'Описание новости 1' },
        { title: 'Заголовок новости 2', description: 'Описание новости 2' },
        // Добавьте другие новости в массив
    ];

    return (
        <div>
            <h1>Новости</h1>
            <NewsFeed news={news} />
        </div>
    );
};

export default App;
